import React, {useContext} from 'react';
import Navigation from '../components/Navigation';

import IsometricBlock from '../components/IsometricBlock';
import { DiJavascript, DiHtml5, DiCss3Full, DiReact } from 'react-icons/di';


import LanguageContext from '../components/LanguageContext';
import SocialNetwork from '../components/SocialNetwork';
import ParametresBanner from '../components/ParametresBanner';


const Skills = () => {

    const language = useContext(LanguageContext);


    return (
        <div className="skills">
            <Navigation/>
            <ParametresBanner/>
            <div className="container">
            <h2>{language.language === "Shakespeare" ? ".Skills" : ".Compétences et connaissances"}</h2>     
                <div className="technos">

                    <div className="sections front-end">
                        <ul>
                            <IsometricBlock language={'Html'} icon={ DiHtml5 } color={"#e34b20"} number={10}/> 
                            <IsometricBlock language={'Css'} icon={ DiCss3Full } color={"#2187d2"} number={8}/>
                            <IsometricBlock language={'Javascript'} icon={ DiJavascript} color={"yellow"} number={7}/>
                            <IsometricBlock language={'React'} icon={ DiReact } color={"#53d2fa"} number={5}/>
                        </ul>
                    </div>

                    <div className="sections back-end">

                    </div>

                    <div className="sections graphique">

                    </div>
                </div>
            </div>    
            <SocialNetwork/>
        </div>
    );
};

export default Skills;
